r($,"b3m","aNc",()=>A.b([A.abh("Q1. Whether Data Entry Operators and employees in similar categories are included under the minimum wage provisions of the Code on Wages, 2019? \n\nAns: Yes. The concept of scheduled employment has been done away under the Code on Wages. The Code is now universally applicable to all employees, irrespective of their sector or category.\n\nQ2. Is a daily wage worker not eligible for bonus?? \n\nAns: Bonus is payable to every employee who has worked for at least thirty days in an accounting year as per the wage ceiling prescribed by the appropriate government. \n \nQ3. Will the new concept of floor wage reduce the minimum wages fixed by the State??\n \nAns: No, Floor Wage is a baseline. Where the minimum rates of wages fixed by the State Government earlier is more than the floor wage, the State Government shall not reduce such minimum rates of wages fixed by it earlier. \n\nQ4. Will the revised definition of wages under the Code, 2019 reduce employee wages?\n \nAns: No. The definition brings transparency and uniformity. Allowances exceeding a fixed percentage as notified by central government are added back to wages, increasing the base for PF, gratuity, and bonus, benefiting workers. It will strengthen social security of employees. \n\nQ5. Does the Code on Wages allow employers to make too many deductions from workers' wages? \n\nAns: No. The Code caps all deductions at 50% of wages\u2014uniform and protective compared to earlier 75% for cooperative deductions. The deduction are restricted to 50% of wages. \n\nQ6. Will the fixation of minimum wages become arbitrary under Central Government control? \n\nAns: No. The Central as well as the State Governments will fix minimum wages within their respective jurisdictions. They must set these wages above the floor wage and after consulting workers and employers representatives. So, the process is fair, balanced, and not arbitrary\n\nQ7. Will the inspector under the Code facilitate only the employers? \n\nAns: No. The duties and powers of the inspector are retained, and he will enforce the provisions, simultaneously raising awareness among workers about their rights and guiding employers in compliance. \n\nQ8. Is it true that working hours been extended in a way that deprives workers of overtime? \n\nAns: No. Flexibility in working hours will not curtail the minimum wage, and employees working beyond normal hours are entitled to the overtime rate which shall not be less than twice the normal rate of wages. \n\nQ9. Are transgender persons not provided benefits under the Code on Wages, 2019?\n \nAns: The Employers shall not discriminate on ground of gender including transgender in matter relating to wages, recruitment of an employee for the same work or work of a similar nature and in the conditions of employment. \n\nQ10. Does compounding of offences allow employers to escape punishment? \n\nAns: No. Deterrent and enhanced penalties are provided under the Code on Wages. Employers are given the opportunity to rectify irregularities; however, compounding is limited to the first offence and a repeat of offence within a period of 5 years is punishable with imprisonmen responsibilities. \n\nQ11. Is only permanent employee covered under the Code? \n\nAns: No. The Code covers all employees, including full-time, part-time, temporary, casual and contractual workers. \n\nQ12. Does the Code on Wages benefit only organized sector workers? \n\nAns: No. The Code on Wages applies to all employees, employed in the organized or unorganized sector. It ensures minimum wages and timely payment. The Code universalizes minimum wages for all categories of employees. \n",!1,"FAQs - Code on Wages, 2019",null),A.abh("A. General Framework & Registration \n\nFAQ 1: Are all procedures under the Social Security Rules mandatory in digital mode?\n \nAnswer: No. While the Rules prioritise digital processes to ensure transparency and ease of access, physical submission is also permitted in specified cases. For instance, claims relating to gratuity and maternity benefits may be submitted physically in addition to electronic modes. \n\nFAQ 2: Does registration under the Rules guarantee automatic payment of benefits? \n\nAnswer: No. Registration is only an entry point that enables workers to access various social security schemes. Benefits are payable only under schemes that are onboarded on the relevant portal (such as the e-Shram portal) and subject to fulfilment of scheme-specific eligibility conditions. \n\nB. Schemes, Rule-Making & Social Security Funds \n\nFAQ 3: Can the Social Security Rules be amended only through Parliament? \n\nAnswer: No. The Rules constitute subordinate legislation. Accordingly, they can be modified, revised, or updated through government notifications, without requiring Parliamentary approval. \n\nFAQ 4: Can Social Security Funds be merged with general government accounts? \n\nAnswer: No. The Rules mandate that Social Security Funds be maintained as separate accounts. They also provide for periodic reporting, audit by the Comptroller and Auditor General of India (CAG), and restricted utilisation exclusively for worker welfare. \n\nC. Maternity Benefit Provisions \n\nFAQ 5: Can maternity benefit claims be rejected for not using prescribed forms? \n\nAnswer: No. The Rules clearly state that procedural lapses do not defeat substantive rights. Applications may be submitted physically on plain paper or electronically, and claims cannot be rejected solely due to non-use of prescribed formats. \n\nFAQ 6: Is certification by a registered medical practitioner mandatory for maternity benefits? \n\nAnswer: No. The Rules broaden acceptable proof and allow certificates from ASHAs, Auxiliary Nurse Midwives (ANMs), local authorities, and other prescribed village or municipal officials, in addition to registered medical practitioners. \n\nFAQ 7: Are nursing breaks strictly limited to two fixed intervals? \n\nAnswer: No. While the Rules prescribe minimum nursing breaks, they also allow additional time, including travel time, depending on the distance to the cr\xe8che or childcare facility. \n\nFAQ 8: Must cr\xe8che facilities always be located within the employer's premises? \n\nAnswer: No. The Rules permit common cr\xe8ches, shared or pooled arrangements, and negotiated facilities, particularly to assist smaller establishments. Where cr\xe8che facilities are not provided, payment of a cr\xe8che allowance is mandated. \n\nD. Gratuity Rules \n\nFAQ 9: Can gratuity be claimed only after employment ends? \n\nAnswer: No. The Rules permit advance submission of gratuity applications where the date of retirement or cessation of employment is known in advance. \n\nFAQ 10: Does delay in filing gratuity applications lead to forfeiture of claims? \n\nAnswer: No. The Rules explicitly provide that delay alone cannot invalidate a gratuity claim. \n\nFAQ 11: How is gratuity payable to minor nominees protected? \n\nAnswer: The Rules require gratuity amounts payable to minor nominees to be invested in term deposits with specified nationalised banks, ensuring safety and future benefit to the nominee. \n\nFAQ 12: Do employers have unfettered discretion to reject gratuity claims? \n\nAnswer: No. The Rules prescribe mandatory notices, reasoned orders, defined timelines, and appeal mechanisms, ensuring transparency and preventing arbitrary decisions. \n\nE. Building and Other Construction Workers' Welfare \n\nFAQ 13: Is BOCW Welfare Cess payable only after completion of construction? \n\nAnswer: No. The Rules permit advance payment of cess based on self-assessment, with final adjustment upon completion and assessment. \n\nFAQ 14: Can BOCW Cess be paid in instalments without disclosures? \n\nAnswer: No. Instalment payments are allowed only with disclosure of work progress and cost assessment, and are subject to verification and scrutiny. \n\nFAQ 15: Is refund of excess BOCW Cess allowed? \n\nAnswer: Yes. The Rules provide a time-bound refund mechanism for excess cess deposited, following assessment or appellate orders. \n\nFAQ 16: Who is responsible for payment of BOCW Cess? \n\nAnswer: Responsibility is clearly allocated among employers, contractors, government departments, and public sector undertakings, depending on the nature and execution of the construction work. \n\nFAQ 17: Do construction workers lose welfare benefits when they move across States? \n\nAnswer: No. The Rules enable inter-State portability of registration and benefits, subject to updation of migrant worker data on the destination State portal. \n\nF. Gig and Platform Workers \n\nFAQ 18: Are only direct engagements by aggregators covered? \n\nAnswer: No. The Rules cover gig and platform workers engaged through subsidiaries, associate companies, holding companies, LLPs, and third-party arrangements. \n\nFAQ 19: Does failure to update gig worker data permanently disqualify workers? \n\nAnswer: No. Non-updation leads to temporary ineligibility. Eligibility can be restored upon updating required information on the designated portal. \n\nG. Compliance, Inspection & Enforcement \n\nFAQ 20: Are inspections under the Rules routine and random? \n\nAnswer: No. The Rules emphasise risk-based inspections, corrective directions, and compliance notices with defined timelines before initiating penal action. \n\nFAQ 21: Are penalties imposed automatically for every non-compliance? \n\nAnswer: No. The Rules provide for notice, opportunity to comply, hearing, reasoned orders, and compounding of offences before prosecution. \n\nFAQ 22: Are appeals under the Rules time-bound? \n\nAnswer: Yes. The Rules prescribe clear limitation periods, standard appeal formats, and timelines for disposal. \n\nH. Exemptions & Trust Governance \n\nFAQ 23: Are exempted establishments free from regulatory oversight? \n\nAnswer: No. Exempted establishments must meet eligibility conditions, audit and reporting requirements, and exemptions may be cancelled upon structural changes. \n\nFAQ 24: Are trusts managing exempted funds unregulated?\n\nAnswer: No. The Rules mandate Boards of Trustees, equal employer-employee representation, periodic meetings, and arm's-length governance norms. \n\nI. Administration & Records \n\nFAQ 25: Must all records be maintained only at the workplace? \n\nAnswer: No. The Rules allow electronic maintenance of records or storage at a notified nearby location, provided they are accessible during inspection. \n\nFAQ 26: Are the Social Security Rules rigid and inflexible? \n\nAnswer: No. The Rules explicitly allow revision of limits, forms, contribution rates, and procedures through government notifications, enabling adaptability to emerging needs.",!1,"FAQs on Social Security Codes",null),A.abh("Q 1. Whether raising the threshold for definition of \"factory\" (from 10 workers with power / 20 without power to 20 workers with power / 40 without power) will exclude workers from safety and welfare protections? \n\nAns:  No. The rights of workers regarding health, safety and welfare would be protected as these provisions are applicable for the establishments having 10 or more employees. \n\nQ 2. Does increased licensing threshold for contract labour from 20 to 50 will deprive contract workers of protections? \n\nAns: No. All establishments having 10 or more employees must comply with safety and welfare measures. The increases licensing threshold is for administrative ease and does not affect workers' entitlements/protections. \n\nQ 3. Will allowing flexibility in working hours up to 12 hours per day will exploit workers? \n\nAns: No. The Code prescribes 8 hours per day and 48 hours per week as standard, with some flexibility to extend daily hours with the consent of workers on payment of overtime, at twice the rate wages. \n\nQ 4. Whether it is not unsafe to allow women to work at night? \n\nAns: No. The Code gives women's right to work in any establishment and night shift with the safeguard of adequate safety, transport, and security arrangements\u2014thus promoting gender equality with safeguards. Moreover, consent of women worker is mandatory to work in night. \n\nQ 5. Will replacing inspectors with inspector-cum-facilitators not weaken the enforcement? \n\nAns : No. The new system of inspection promotes transparent, technology-based inspections while maintaining accountability and facilitating employer ensuring better compliance.  Code promotes compliance. Better compliance will ensure better protection to workers.   \n\nQ 6. Is it true that health and welfare facilities are limited to large establishments only? \n\nAns : No. The Code mandates health and safety provisions for all workers employed in establishments employing 10 or more employees. \n\nQ 7. Will rationalization of 13 labour laws into one Code, dilute workers' rights? \n\nAns : No. The Code simplifies and harmonizes provisions with protection of worker rights. Simplification and harmonization remove ambiguities and brings consistence in protection of workers.\n\nQ 8.  Whether portability of migrant worker benefits is ineffective and would not reach to beneficiary? \n\nAns : No. The Code requires setting up of Toll free helpline number for Inter State Migrant Worker (ISMW). ISMW can reach to govt through toll free number in case  of difficulty faced by them. \n\nQ 9.  Will state rule-making powers cause dilution of worker protections? \n\nAns : Labour is in concurrent list of the Constitution.  Accordingly, State are allowed to make rules for certain allocated sphere keeping in view of the local conditions and responsiveness to regional needs. \n\nQ 10. Is it true that duties of employers are towards regular workers only and do not cover contract workers and inter-state migrant worker (ISMW) ? \n\nAns : No. The Code does not distinguish regular and contract workers or ISMW. The Code extends benefits to all workers, including contract and inter-state migrant workers. \n\nQ 11.  Is it true that allowing women to work in hazardous occupations is unsafe? \n\nAns: No. The Code ensures women's right to work in any occupation with adequate safety and with sufficient safeguards to promote gender equality   \n\nQ 12. Is it true that no protection provided to fixed-term employment workers in the code? \n\nAns :  The Code covers all employees, including fixed-term employment workers and they will get all benefits like appointment letters, annual health check-ups etc. \n\nQ 13.  Whether OSH & WC Code favours employers by reducing penalties for violations? \n\nAns : No. Rather, penalties have been rationalized and only minor offences are compoundable, while serious safety breaches attract severe penalties including imprisonment. \n\nQ 14. Does OSH Code provide any specific welfare facilities for transgender workers? \n\nAns : Yes. The Code recognizes first time the transgender workers and mandates separate bathing, toilet, restroom etc facilities for them ensuring dignity, privacy and equal access at the workplace. \n\nQ 15. Is there any specific provision for drivers under the OSH Code? \n\nAns : Yes. The Motor Transport Workers including drivers are covered under the Code. The provisions on safety, health and welfare under the Code apply to them, including working hours, rest intervals etc.\n\nQ 16. Are contract workers covered for welfare facilities? \n\nAns : Yes. The Contract workers are covered for welfare facilities which will now be provided by the principal employer. \n\nQ 17. Is it true that stuntmen and dubbing artists are not provided any benefits under the OSH Code? \n\nAns : No. Under the definition of \"audio-visual worker\" in the Code, stuntmen and dubbing artists are also covered and will get the safety, health and welfare benefits provided to audio visual workers. \n\nQ 18- What is the minimum criterion in terms of number of days for a worker to be eligible for annual leave with wages as per the provisions of OSH&WC Code, 2020? \n\nAns- A worker should have worked for 180 or more days in a calendar year to be eligible for annual leave with wages.  \n\nQ 19.  Whether contract labour worker be issued an experience certificate?  \n\nAns- Yes, a contract worker can demand from concerned contractor to issue experience certificate.",!1,"FAQs on Occupational Safety, Health and Working Conditions (OSH) Code, 2020",null),A.abh("",!0,"FAQs on Labour Codes",A.b([A.fv("Which rules will be applicable during the transition period?","As per the provisions of Section 6 of General Clauses Act, 1897, old rules will remain in force till final notification of new rules under the Code, to the extent these are in line with Codes.","1"),A.fv('What does the term "wages" mean?','The definition of "Wages" covers: \n\u2022 All remuneration whether by way of salaries, allowances or otherwise payable to a person employed. This includes: Basic pay, Dearness allowance, Retaining allowance, if any \n\n\u2022 If the payments/allowances other than Basic pay, Dearness allowance and Retaining allowance exceed 50% or such percentage as notified of all remuneration, then amount exceeding 50% or such percentage as notified shall be added in the "Wages". ',"2"),A.fv("Definition of wages and the components it would cover.",'The definition of "Wages" covers: \n \n\u2022 All remuneration whether by way of salary, allowances or otherwise. These include Basic pay, Dearness allowance and Retaining allowance, if any. \n \n\u2022 If the allowances (except gratuity and retrenchment compensation) exceeds 50% of all remuneration, the excess amount shall be added back to wages. \n \n\u2022 Performance based incentives, Employee Stock Option Plans (ESOPs), variable part of the component or reimbursement-based payments to the employee shall not be part of the wages. ',"3"),A.fv("What is the 50% rule for allowances? ","\u2022 If the allowances and benefits together (except gratuity and retrenchment compensation) exceed 50% of the all remuneration, the excess amount shall be added back to wages. \n\n\u2022 Such added amount shall be treated as wages for statutory purposes. ","4"),A.fv("Whether Leave Encashment be part of allowances? ","\u2022 As mentioned in Section 2(y) of Code on Wages, 2019, leave encashment is not a part of allowances. ","5"),A.fv("Does this definition of wages apply to all labour laws?","\u2022 This single definition of wages applies across all four Labour Codes \n        \n        \u2022 The same definition applies uniformly for statutory calculations","6"),A.fv("Explain the allowance rule with a clear illustration?","\u2022 Total remuneration: \u20b976,000 per month \n\u2022 Basic Pay + Dearness Allowance: \u20b920,000 \n\u2022 Allowances: \u20b940,000 \n\u2022 Other components (Gratuity and retrenchment compensation): \u20b916,000 \n\u2022 Total allowance paid: \u20b956,000 \n\u2022 Max. allowance allowed for calculation of wages (50% of total remuneration): \u20b938,000 \n\u2022 Excess allowance over 50% limit: \u20b92000 \n\u2022 \u20b92000 shall be added back to wages (Basic Pay + DA) for statutory compliances. \n\u2022 Statutory calculations shall be made on revised wages: \u20b922,000 ","7"),A.fv("Whether Gratuity calculation will be applicable prospectively or retrospectively.","\u2022 Gratuity will be applicable w.e.f. 21st Nov, 2025 i.e. date of enforcement of the Code. ","8"),A.fv("Clarification on gratuity calculation in view of many companies considering December month asyear end.   ","\u2022 Gratuity will be applicable w.e.f. 21st Nov, 2025 i.e. date of enforcement of the Code. Establishments may make provision as per accounting norms.","9"),A.fv("When gratuity is payable to an employee? ","Gratuity shall be payable on following events:\n\u2022 On termination \n\u2022 On superannuation (retirement due to age) \n\u2022 On resignation \n\u2022 On death or disablement due to accident or disease \n\u2022 On expiration of a fixed-term employment contract \n\u2022 On any other event notified by the Central Government ","10"),A.fv("Are there any special provisions related to gratuity in certain cases?","\u2022 Completion of five years of continuous service is not necessary in case of: \n\u2022 Death (paid to nominee or legal heirs) \n\u2022 Disablement \n\u2022 Expiration of fixed-term employment \n\u2022 Other events notified by the Central Government \n\u2022 If the nominee or heir is a minor, the share shall be deposited with a competent authority and invested in bank/financial institution for the benefit of such minor until majority ","11"),A.fv("How is gratuity calculated? ","\u2022 For every completed year of service or part thereof in excess of six months: \n\u2022 15 days' wages per year (or such number as notified by Central Government) based on the rate of wages last drawn. \n \nSpecial cases: \n\u2022 Piece-rated employees: Daily wages calculated as average of total wages for the three months preceding termination (excluding overtime) \n\u2022 Seasonal employees: 7 days' wages per season \n\u2022 Fixed-term employment or deceased employees: Gratuity paid on pro-rata basis \n\u2022 The maximum gratuity is as notified by the Central Government which is currently \u20b9 20 lakhs. \n\u2022 For employees re-employed after disablement: \n\u2022 Wages for the period preceding his disablement shall be taken to be the wage received by him during that period. \n\u2022 Wages for the period subsequent to his disablement shall be taken to be the wages as so reduced. \n","12"),A.fv("Does gratuity affect other agreements or awards? ","\u2022 Nothing shall affect the right of an employee to receive better gratuity terms under any: \n\u2022 Award \n\u2022 Agreement \n\u2022 Contract with employer ","13"),A.fv("Whether the person drawing wages \u20b918,000/- or more will be covered under the definition of worker as per OSH & WC Code.","\u2022 Any person, who is employed in a supervisory capacity drawing wages exceeding \u20b918,000/- (or an amount as may be notified by the Central Government from time to time) is not included in the definition of worker.","14"),A.fv(" Clarity on Core and Non-core activities.","\u2022 Core and non-core activities are clearly defined under the OSH & WC Code, 2020 [Section 57]. Principal employer may engage contract labour for core activities which are ordinarily carried out through contractor, or of intermittent nature or involve sudden increase in volume of work requiring time-bound completion.  ","15"),A.fv("Whether Journey Allowance for ISMW within the State for the long distance workers may be allowed.","\u2022 As per OSH & WC Code, 2020, the employer shall pay to and fro journey allowance to ISMW once in a year from his native place to place of employment. ","16"),A.fv("How will the ESI coverage be governed until the finalisation of Rules?","\u2022 The definition of wage has come into force with notification of the Code w.e.f. 21st Nov, 2025. ","17")],A.az("w<vq>")))],A.az("w<vp>")))
